    .container{
       display: flex;
       justify-content:center;
       flex-direction: column;
       padding: 10%;;
       align-items: center;
       flex-wrap: wrap;
    }
    .incont{
        display: flex;
        justify-content: space-between;
        align-items: center;
        margin-top:70px;
        width:350px;
        height:120px;
        background:#ECEFF1;
        box-shadow: 10px 10px rgba(0,0,0,0.2);
        border-radius:100px;
    }
    .incont::after,.incont::before{
    content:"";
    position:relative;
    display:inline-block;
    background:inherit;
    border-radius:inherit;
    }
    #btn{
        display: flex;
        text-decoration: none;
        justify-content: center;
        width: 8em;
        font-family: sans-serif;
        color: rgb(0, 119, 255);
        font-weight: bold;
        font-size: 14px;
        padding: 2em;
        border-radius: 3.5em;
        border-color: transparent;
    }
    #btn:hover{
        background-color: rgb(134, 182, 254);
    }
    #btn:active{
        transform: scale(1.05);
        background-color: rgb(3, 132, 206);
    }
    .incont h2{
        font-family: 'Poppins', sans-serif;
        color: rgb(0, 145, 255);
        font-size: 20px;
    }
</style>
<body>
    <div class="container">
        {% for room in rooms %}
            <div class="incont">
                <h2>{{room.name}}</h2>
                <a id="btn" href="{% url 'room' room.slug %}">Join</a>
            </div>
        {% endfor %}
    </div>
</body>
</html>
{% endblock content %}
